41-744338\r\n</p>\r\n<p align="left">\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fax&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 62-541-734544\r\n</p>\r\n</div>\r\n', '', -2, 1, 0, 1, '2004-06-12 11:54:06', 64, 'Web Master', '2008-11-25 11:21:08', 67, 0, '0000-00-00 00:00:00', '2004-01-01 00:00:00', '0000-00-00 00:00:00', 'capture_16_.jpg|center|outboard motor yamaha|0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 63, 0, 0, 'outboard motor yamaha\r\nmesin tempel\r\nmotor tempel\r\noutboard engine\r\nmarine engine', 'Welcome to Yamaha Outboard Motor Indonesia', 0, 185),
