(2, 'MESIN TEMPEL/ OUTBOARD MOTOR YAMAHA', '', 'Yamaha F350 Developed with Boatbuilders&rsquo; Input, ''''F350 Class'''' Boats Emerge <br />\r\n<br />\r\nMIAMI--(BUSINESS WIRE)--In addition to being the boating industry&rsquo;s first V8 5.3-liter, four-stroke outboard motor, the 350-horsepower Yamaha F350 is unique for the way in which it was developed &ndash; through Yamaha&rsquo;s relationships with a diverse group of independent U.S. boat builders. <br />\r\n<br />\r\n&ldquo;Our boat builder partners wanted an outboard not only for today&rsquo;s boats, but for boats of the future,&rdquo; said Phil Dyskow, Yamaha Marine Group president. &ldquo;They know better than anyone where the market for boats is headed, and they knew their customers would want clean, reliable, quiet outboard power for a new class of outboard boats. We like to think of them as F350-class boats.&rdquo; <br />\r\n<br />\r\n&ldquo;The idea that led to the Yamaha F350 took shape several years ago, when a group of us (boat builders) met with Yamaha engineers,&rdquo; said Leon Slikkers, chairman and COO of S2 Yachts (the parent company of Pursuit Boats). &ldquo;They wanted to get a feel for what each of us wanted in an outboard of the future. <br />\r\n<br />\r\n&ldquo;Big boats were becoming more popular, so we said we needed a very powerful outboard, something with about 350 horsepower. \r\n', '&ldquo;There was a time when outboards were smoky, noisy things. The four-stroke changed all that. Now the professional fisherman likes having that smooth-running jewelry back there.&rdquo; <br />\r\n <br />\r\n The Pursuit Boat division of S2 Yachts is now developing a 36-foot outboard-powered boat, joining a variety of boat builders at the leading edge of the trend. <br />\r\n <br />\r\n Another Yamaha partner with an F350-class entry is Edgewater Boats. &ldquo;The market is changing,&rdquo; said Peter Truslow, president of Edgewater Boats. &ldquo;We see a trend with some customers; they want to go 50 to 100 miles off shore; they want to fish; they want to enjoy a boat, but they don&rsquo;t want to maintain a 50- to 60-foot yacht. <br />\r\n <br />\r\n &ldquo;We have customers who have used our smaller outboard boats as tenders for their yachts. Now we can build a boat that does everything they need. This year, we will produce a 38-foot Edgewater outboard-powered boat that has all the functionality of a larger boat in a smaller, more efficient package. <br />\r\n <br />\r\n &ldquo;Our new boat will use high-tech materials to make it lighter and stronger. The F350 is exactly what we needed to power it. The Yamaha F350 has the performance of an outboard with the efficiency of a diesel; that really makes sense for this kind of a boat. To our customers, an outboard means lower maintenance. At the same time, it makes more room on the boat. In a cabin boat, it means having an aft cabin instead of an engine room.&rdquo; <br />\r\n <br />\r\n In addition to Pursuit and Edgewater, several Yamaha partners are planning F350-class outboard boats. Yamaha Partner Grady-White introduced a 36-foot outboard-powered boat last year, the Express 360, a certain candidate for Yamaha F350 power. <br />\r\n <br />\r\n &ldquo;With 96 square feet of cabin room, the Express 360 exemplifies the efficiency of using outboard power in a larger boat design,&rdquo; said Dyskow. &ldquo;Outboard power also means there is room available for features customers want, like its aft deck refrigerator/freezer.&rdquo; <br />\r\n <br />\r\n Yamaha Marine products are marketed throughout the United States and around the world. Yamaha Marine Group, based in Kennesaw, Ga., supports its 2,200 dealers and OEM partners with marketing, training and parts for Yamaha&rsquo;s full line of products and accessories and strives to be the industry leader in reliability, technology and customer service. Yamaha is the only outboard engine brand to have earned NMMA&rsquo;s C.S.I. Customer Satisfaction Index award every year since its inception. For more information, call (800) 88-YAMAHA or visit <a href="http://outboardmotoryamaha.com" title="OUTBOARD MOTOR YAMAHA">OUTBOARD MOTOR YAMAHA</a> \r\n', 1, 2, 0, 3, '2004-08-09 08:30:34', 64, '', '2008-11-17 13:31:49', 67, 0, '0000-00-00 00:00:00', '2004-08-09 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 4, 0, 12, '', '', 0, 667),
(3, 'YAMAHA OUTBOARD MOTORS', '', '<p><img src="http://www.robincurnow.co.uk/images/photos/Yamaha-4-Stroke-2.jpg" alt="outboard motor yamaha" title="OUTBOARD MOTOR YAMAHA" hspace="1" vspace="1" width="250" height="167" align="right" />Travel almost anywhere in the world, from the busiest marina to the quietest harbour, and the evidence is all around you: Yamaha builds the world&#39;s most popular outboard motors.<br /><br />When you invest in an outboard motor, you want to be absolutely certain that you get the perfect match for your boat and your type of boating.<br /><br />That&#39;s why Yamaha outboard motors brings you the world&#39;s biggest range of outboard configurations. More than 50 different models, stretching from 2.5 to 300 horsepower. Plus around 160 model variants encompassing everything from steering and starting method to tilt system and transom height.<br /><br />A huge choice. So you can make the perfect match</p><p><img src="http://www.robincurnow.co.uk/images/photos/yamaha-outboard-motors.jpg" alt=" " width="120" height="110" /></p><p>Pricing and more information<br />We are always happy to provide the best prices for Yamaha outboard motors. </p>', '', 1, 2, 0, 3, '2004-08-09 08:30:34', 62, '', '2008-11-03 12:22:05', 64, 0, '0000-00-00 00:00:00', '2004-08-09 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 3, 0, 13, '', '', 0, 439),
(4, 'F350 5.3 liter V8 outboard motors save fuel', '', '<img src="http://www.blogcdn.com/www.autobloggreen.com/media/2008/06/yamaha_f350.jpg" alt="outboard motor yamaha engine" title="OUTBOARD MOTOR YAMAHA" hspace="1" vspace="1" width="185" height="360" align="right" />It''s not often that consumers choose a V8 engine for its low fuel consumption, but that seems to be exactly what is happening with the Yamaha F350 outboard motor. This sixty-degree engine is a rather high-tech design, featuring 32 valves and double overhead cams to produce some 350 horsepower at the prop shaft. One reason cited for its ability to save fuel is that the engines don''t need to work as hard as smaller, high-strung engines.<br />\r\n<br />\r\nAccording to Shane Kearns, who operates a water taxi in Australia, &quot;Over the 35 engine hours clocked so far I have nearly halved my fuel bill with the twin F350 outboards returning a combined 31 liters per hour across a range of harbor conditions and boat loads. I originally thought my fuel gauges were wrong until I started closely monitoring my fuel intake.&quot; When first built, his boat featured twin two-stroke engines, which were later replaced with Yamaha four-stroke outboards. His latest F350s not only reduce fuel consumption but also provide additional speed and power, things which don''t normally go together.\r\n', '', 1, 2, 0, 3, '2004-08-09 08:30:34', 64, '', '2008-11-24 15:19:35', 67, 62, '2009-03-13 08:43:27', '2004-08-09 00:00:00', '0000-00-00 00:00:00', 'capture_20_.jpg|center|outboard motor yamaha|0||bottom|center|', '', 'pageclass_sfx=\nback_button=\nitem_title=0\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 28, 0, 11, 'outboard motor\r\nmesin tempel\r\nmotor tempel\r\noutboard engine\r\nyamaha marine\r\nmarine engine', 'Yamaha Outboard Motor Indonesia', 0, 644),
(5, 'About Us', 'COMPANY PROFILE', '<blockquote>\r\n	Selamat datang di website kami... <br />\r\n</blockquote>\r\n<h2 align="center">YAMAHA <i>FOUR STROKE </i>OUTBOARDS </h2>\r\n<h3 align="center">Main Dealer Yamaha Outboard Motor </h3>\r\n', '', 1, 0, 0, 0, '2004-08-19 20:11:07', 62, '', '2009-04-01 10:58:51', 62, 0, '0000-00-00 00:00:00', '2004-08-19 00:00:00', '0000-00-00 00:00:00', 'logo-yamaha-engines-small.gif|left|outboard motor yamaha|0||top||\r\nlogo_yamaha_out_2007_md.gif|right|outboard motor yamaha|0||top|right|', '', 'menu_image=-1\nitem_title=1\npageclass_sfx=\nback_button=\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=', 3, 0, 3, 'outboard motor yamaha\r\noutboard motor\r\noutboard\r\nmesin tempel\r\nmotor tempel\r\noutboard engine\r\nmarine engine\r\nyamaha marine', 'Welcome to Yamaha Outboard Motor Yamaha Indonesia', 0, 2167),
