(21, 'Yamaha OBM 15HP', 'Yamaha OBM 15HP bensin', '<div align="right">\r\n{mosimage}<strong>Features Specifications: YAMAHA 15 HP 4 STROKE OUTBOARD MOTOR</strong><br />\r\n<br />\r\nNEW 2007 YAMAHA 15 HP 4 Stroke Outboard Motor.<br />\r\n<br />\r\nThese are the specifications:<br />\r\n<br />\r\n2007 F6MSH with a 15&quot; Shaft.<br />\r\n4 Stroke 15 H.P.<br />\r\nManual Tilt with Manual Start and Tiller Handle.<br />\r\n<br />\r\nThismotor comes from an authorized Yamaha Sales and Service Center. Themotor pictured is a floor model on display. The motor you are biddingon is still in its original shipping box. These boxes can be a bit beatup but the motor is enclosed in a durable styrofoam clamshell. Themotor will be shipped in its original carton bound with many layers ofheavy gauge stretch wrap.<br />\r\n</div>\r\n', '', -1, 5, 0, 16, '2008-11-19 12:28:36', 67, '', '2009-09-28 12:30:45', 67, 0, '0000-00-00 00:00:00', '2008-11-19 12:27:39', '0000-00-00 00:00:00', 'yamaha_f350.jpg|||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 4, 0, 5, '', '', 0, 264),
