(7, 'Inflatables, RIBS & Boats', '', '<p><img src="http://www.robincurnow.co.uk/images/photos/inflatablesShow.jpg" alt=" " hspace="1" vspace="1" align="right" />Inflatables, RIBS &amp; Boats We currently stock inflatable boats and ribs from these manufacturers: <br />Plastimo<br />Quicksilver Inflatables<br />Terhi Inflatable Boats<br />New Wetline RIB on special offer <br /><br />Contact Robin Curnow for our up to date, competitive prices on all these top inflatable brands as well as mail ordering supplied throughout the UK. <br /><br />Alongside Winter storage for outboard motors, we offer the same winter storage for inflatable boats at competitive rates, please contact us for further details and prices.<br /><br />We are rarely beaten on price and our quality service is what our business is all about. <br /><br />A range of accessories is also available.</p><p>&nbsp;</p><div style="text-align: center"><img src="http://www.robincurnow.co.uk/images/photos/butflash.gif" alt=" " /></div> <br /><p>&nbsp;</p>', '', -2, 1, 0, 1, '2004-07-07 11:54:06', 62, '', '2008-11-25 11:21:03', 64, 0, '0000-00-00 00:00:00', '2004-07-07 00:00:00', '0000-00-00 00:00:00', 'food/bun.jpg|right||0', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 2, 0, 0, '', '', 0, 27),
