(12, '4 Stroke 350HP', '', '<img src="images/stories/yamaha_f350.jpg" alt=" " hspace="1" vspace="1" width="185" height="360" align="right" />31 December 2006 saw the deadline for the manufacture of carburettor two stroke outboard motors to be sold in the EU for the leisure market.<br />\r\n<br />\r\nHowever, any two stroke outboard motor which has already been placed on the market i.e. is in the Manufacturers, Distributors or Dealer stock before 31 December 2006 are deemed to be already on the market and can be sold.<br />\r\n<br />\r\nWe therefore have limited stocks of Yamaha, Mercury and Johnson two stroke outboard motors currently available and suggest customers contact us at their earliest convenience to avoid disappointment as the two stroke motor is still much sought after.\r\n', '', 1, 2, 0, 3, '2008-11-03 12:25:19', 64, '', '2008-11-27 08:49:09', 67, 0, '0000-00-00 00:00:00', '2008-11-03 12:22:12', '0000-00-00 00:00:00', 'Yamaha-4-Stroke-2.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 6, 0, 9, '', '', 0, 687),
(30, 'Oil Yamalube', '', 'Four Stroke Oil<br />\r\n<br />\r\nFour Stroke Marine{mosimage}<br />\r\n4M FC-W&reg; Re-formulation<br />\r\n4M FC-W&reg; (SAE 10W-30)<br />\r\n4M FC-W&reg; (SAE 20W-40)&nbsp;<br />\r\n<br />\r\nBetter for Your Yamaha<br />\r\nDon&rsquo;t trust your Yamaha to off-the-shelf substitutes. This is the oil designed for your four stroke Yamaha outboard &ndash; precisely formulated to Yamaha&rsquo;s uncompromising standards and extensively performance tested.<br />\r\n<br />\r\nBetter Marine Protection<br />\r\nThe trend in marine power is moving to four stroke technology. Though many of these engines are in the same displacement and power output range as high performance automobile engines, marine operating conditions are significantly more challenging. Four stroke marine engines are subjected to high loads and extended full-throttle operation, while operating in an environment that includes high humidity and salt air. In these severe conditions, premium lubricity is critical. Which is why the NMMA (National Marine Manufacturers Association) created the FC-W&reg; rating, a performance standard specifically for oil used in four stroke marine engines. Yamalube 4-M is FC-W&reg; certified.<br />\r\n<br />\r\nBetter Lubrication<br />\r\nYamalube 4-M surpasses Yamaha factory requirements, with a superior formulation that provides...<br />\r\n- a higher level of bearing protection<br />\r\n- superior rust and corrosion resistance<br />\r\n- polymers that resist breaking down &ndash; even under the severe high load, high speed conditions common to outboards<br />\r\n- more anti-wear additives than regular passenger car motor oils<br />\r\n- and the highest amount of detergents and dispersants, needed to keep your marine engine clean inside.&nbsp;<br />\r\n<br />\r\nBetter Results<br />\r\nThe difference? Easier starts, dependable protection, while enabling your engine to deliver high performance and longer engine life. Protect your investment and give your Yamaha four stroke outboard the protection it deserves - insist on Yamalube 4M FC-W&reg;. Available exclusively at your authorized Yamaha Marine dealer.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\nTwo Stroke Oil<br />\r\n<br />\r\n&nbsp; 	Two Stroke Outboard{mosimage}<br />\r\nYamalube 2M<br />\r\nTwo Stroke Engine Oil<br />\r\nSemi-Synthetic Injector Oil For Outboard Motors<br />\r\nNaturally, any outboard oil should be TC-W3&reg; approved. Yamalube oils are so good they actually have been used as the test oil for many of the TC-W3 ratings! That means that all other TC-W3 oils had to measure up to our high standards. Given that, we raised the bar again with Yamalube 2M - the new standard for outboard oils.<br />\r\n<script type="text/javascript">\r\n<!--\r\ngoogle_ad_client = "pub-9469600514042063";\r\n/* 468x15, created 9/27/09 */\r\ngoogle_ad_slot = "2340865220";\r\ngoogle_ad_width = 468;\r\ngoogle_ad_height = 15;\r\n//-->\r\n</script>\r\n<script src="http://pagead2.googlesyndication.com/pagead/show_ads.js" type="text/javascript">\r\n</script>\r\n', '', 1, 1, 0, 19, '2008-11-26 14:34:40', 67, '', '2009-09-28 12:24:08', 64, 316, '2011-02-21 21:10:41', '2008-11-26 14:30:10', '0000-00-00 00:00:00', 'food/8058.4m_20w40_blue_bottles_250w.jpg\r\nfood/2m_2strokeblue_72dpi_ds_100w.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 4, 0, 1, '', '', 0, 368),
