(16, 'Konversi dari minyak tanah ke bensin ', 'Konversi dari minyak tanah ke bensin ', '<p>\r\nKonversi dari minyak tanak ke bensin&nbsp;   \r\n</p>\r\n<p>\r\nMelonjaknya harga minyak dunia mengakibatkan bahan bakar minyak tanah sangat sulit ditemukan di pasar ataupun di jual dengan harga yang sangat tinggi.<br />\r\n<br />\r\nBagi nelayan yang memakai mesin Yamaha EK15 dan EK40, hal ini berakibat sangat fatal.<br />\r\n<br />\r\nUntuk itu, bersama dengan Yamaha Motor Corporation Jepang dan Yamaha Motor Distribution Singapore, KBA akan melakukan aktivitas konversi mesin minyak tanah menjadi mesin berbahan bakar premium.<br />\r\n<br />\r\nAktivitas ini akan kami lakukan dalam beberapa tahap. Tahap pertama akan dilakukan di Kalimantan, bekerja sama dengan 3S Dealer, Indah Motor di Banjarmasin, Dunia Marine di Samarinda/Balikpapan/Tarakan.<br />\r\n<br />\r\nSamarinda: 16-17 June 2008<br />\r\n<br />\r\n&nbsp;  1.&nbsp;     *Target engine: EK40<br />\r\n&nbsp;  2.&nbsp;     *Target jumlah mesin: 100 s/d 150<br />\r\n&nbsp;  3.&nbsp;     *Lokasi: Bengkel Mahmud<br />\r\n<br />\r\n<br />\r\nBalikpapan: 18-19 June 2008<br />\r\n<br />\r\n&nbsp;  1.&nbsp;     *Target engine: EK40<br />\r\n&nbsp;  2.&nbsp;     *Target jumlah mesin: 200 unit<br />\r\n&nbsp;  3.&nbsp;     *Lokasi: Penajam dan Kampung Baru<br />\r\n<br />\r\n<br />\r\nTarakan: 19-20 June 2008<br />\r\n<br />\r\n&nbsp;  1.&nbsp;     *Target engine: EK40<br />\r\n&nbsp;  2.&nbsp;     *Target jumlah mesin: 150 uni<br />\r\n<br />\r\nAktivitas konversi ini kemudian akan dilanjutkan oleh 3S setempat.<br />\r\n<br />\r\n</p>\r\n<script type="text/javascript">\r\n<!--\r\ngoogle_ad_client = "pub-9469600514042063";\r\n/* 468x15, created 9/27/09 */\r\ngoogle_ad_slot = "2340865220";\r\ngoogle_ad_width = 468;\r\ngoogle_ad_height = 15;\r\n//-->\r\n</script>\r\n<script src="http://pagead2.googlesyndication.com/pagead/show_ads.js" type="text/javascript">\r\n</script>\r\n', '', 1, 4, 0, 20, '2008-11-17 13:06:09', 67, '', '20