(18, 'Konversi dari minyak tanak ke bensin ', '', '<p>  Konversi dari minyak tanak ke bensin&nbsp;  </p>  <p>  Melonjaknya harga minyak dunia mengakibatkan bahan bakar minyak tanah sangat sulit ditemukan di pasar ataupun di jual dengan harga yang sangat tinggi.<br />  <br />  Bagi nelayan yang memakai mesin Yamaha EK15 dan EK40, hal ini berakibat sangat fatal.<br />  <br />  Untuk itu, bersama dengan Yamaha Motor Corporation Jepang dan Yamaha Motor Distribution Singapore, KBA akan melakukan aktivitas konversi mesin minyak tanah menjadi mesin berbahan bakar premium.<br />  <br />  Aktivitas ini akan kami lakukan dalam beberapa tahap. Tahap pertama akan dilakukan di Kalimantan, bekerja sama dengan 3S Dealer, Indah Motor di Banjarmasin, Dunia Marine di Samarinda/Balikpapan/Tarakan.<br />  <br />  Samarinda: 16-17 June 2008<br />  <br />  &nbsp;  1.&nbsp;     *Target engine: EK40<br />  &nbsp;  2.&nbsp;     *Target jumlah mesin: 100 s/d 150<br />  &nbsp;  3.&nbsp;     *Lokasi: Bengkel Mahmud<br />  <br />  <br />  Balikpapan: 18-19 June 2008<br />  <br />  &nbsp;  1.&nbsp;     *Target engine: EK40<br />  &nbsp;  2.&nbsp;     *Target jumlah mesin: 200 unit<br />  &nbsp;  3.&nbsp;     *Lokasi: Penajam dan Kampung Baru<br />  <br />  <br />  Tarakan: 19-20 June 2008<br />  <br />  &nbsp;  1.&nbsp;     *Target engine: EK40<br />  &nbsp;  2.&nbsp;     *Target jumlah mesin: 150 uni<br />  <br />  Aktivitas konversi ini kemudian akan dilanjutkan oleh 3S setempat.  </p>  ', '', -2, 4, 0, 20, '2008-11-18 13:38:54', 67, '', '2008-12-01 11:07:31', 64, 0, '0000-00-00 00:00:00', '2008-11-18 13:38:22', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 2, 0, 0, '', '', 0, 0),
