(34, '4 Stroke Portable', '', '<p>\r\n{mosimage} &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;{mosimage}\r\n</p>\r\n<p>\r\n&nbsp;{mosimage}\r\n</p>\r\n', '', 1, 5, 0, 16, '2008-11-28 10:31:07', 67, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2008-11-28 10:29:08', '0000-00-00 00:00:00', 'food/allf.jpg\nfood/f9.jpg\nfood/speckf.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 1, 0, 3, '', '', 0, 729),
(25, 'Propeller', 'Propeller', '<p>\r\nYou<cite title="tes">r propeller can be the deciding factor in your outboard''s ultimate acceleration, top speed, fuel economy, and engine life. There''s only one way to ensure a perfect match to your Yamaha outboard: Use a Yamaha {mosimage}propeller. Yamaha engineers use exacting specifications to engineer our propellers, then they test them with the engines they''re intended for. There''s a Yamaha propeller perfectly matched to every Yamaha engine. For boats of every size. For saltwater or running in the weeds. For high performance and demanding tournament pros. Even our exclusive Dual Thrust&trade; for heavy loads. Want to get the most from your Yamaha outboard? Run with the Yamaha propeller designed to achieve its full performance potential.	&nbsp;</cite><br />\r\n<br />\r\n&nbsp;	Innovation | Reliability | Convenience<br />\r\n<br />\r\nH4 Series Propellers	HS4 &ldquo;High Seas&rdquo; Propellers<br />\r\n{mosimage}Many large boats can benefit from excellent acceleration, quick planing, and maximum &lsquo;grip&rsquo; on the water. For these craft, Yamaha introduces the new HS4 &ldquo;High Seas&rdquo; line of four-bladed propellers.<br />\r\n<br />\r\nHS4 &ldquo;High Seas&rdquo; propellers are designed for V6 four stroke and 200~300 hp two stroke<br />\r\napplications, with thrust to plane, planing at slower engine speeds, and resistance to ventilation in high seas. It&rsquo;s all there, and they&rsquo;re all Yamaha.<br />\r\n<br />\r\nMade of high-quality stainless steel to Yamaha&rsquo;s exacting standards of quality and durability, they will be offered in 21&rdquo;, 22&rdquo;, and 23&rdquo; pitches in both right- and left-hand configurations. Featuring a highly polished finish with cast-in naming on the barrel, they&rsquo;re as impressive out of the water as<br />\r\nthey are in the water.<br />\r\n&nbsp; \r\n</p>\r\n<p>\r\nPontoon Performance Propellers	Pontoon Performance Propellers<br />\r\nGiven their wide array of operational applications and uses, pontoon boats frequently require special {mosimage}propellers for maximum performance and efficiency. That&rsquo;s why Yamaha is introducing its new Pontoon Performance Series of propellers. Their significantly larger blade area helps provide the thrust and control today&rsquo;s larger pontoon boats need by helping add &lsquo;grip&rsquo; and reduce<br />\r\nventilation in turns. Manufactured of high-quality stainless steel, they&rsquo;re available in 9&rdquo;, 10&rdquo;, 11&rdquo;, 12&rdquo;, and 13&rdquo; pitches, fit T50, T60, F75~F115 four stroke engines and 70hp~130hp two-stroke engines, and feature a high-polish finish to make them look as good as they perform.<br />\r\n&nbsp;&nbsp;\r\n</p>\r\n', '<p>\r\n{mosimage}\r\n</p>\r\n<p>\r\nBlack Steel Series-100\r\n</p>\r\n<p>\r\n&nbsp;{mosimage}\r\n</p>\r\n<p>\r\n&nbsp;Perf 4Blade 2nd\r\n</p>\r\n<p>\r\n{mosimage}\r\n</p>\r\n<p>\r\nPerf Xl series 100&nbsp;\r\n</p>\r\n<p>\r\n&nbsp;\r\n</p>\r\n', 1, 1, 0, 18, '2008-11-22 10:15:20', 67, '', '2008-11-24 16:28:56', 67, 67, '2008-12-03 09:06:06', '2008-11-22 10:12:40', '0000-00-00 00:00:00', 'inset_propeller_01a.jpg|||0||bottom||\nfruit/blacksteelserie-100.jpg|||0||bottom||\nfruit/perf4blade2nd-100.jpg|||0||bottom||\nfruit/perfxl_series_prop-100.jpg|||0||bottom||\nfruit/proseriespic-100.jpg\nfruit/saltwaterii-100.jpg\nfruit/saltwaterseriespic-100.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 6, 0, 2, '', '', 0, 401);
