(26, '4 Stroke 40HP', 'F40HP', '<p align="justify"> <strong><em>Performance. Reliability. Convenience and control. Long-term value.</em></strong><br /> These are the benefi ts you look for in a mid-range four stroke outboard. At Yamaha, we&rsquo;re constantly striving to provide all of these, and more, in every outboard we make. Continuing this innovative tradition, Yamaha is proud to announce a new member to the Yamaha outboard family, the F40A. </p> <p align="justify"> &nbsp;<img src="images/stories/250pk.jpg" border="0" alt="Image" title="Image" hspace="6" width="165" height="315" /> </p>', '<strong>PERFORMANCE</strong><br /> This new four stroke is a true outboard; engineered, designed, and developed specifi cally<br /> for the marine environment. It&rsquo;s three-cylinder, single overhead camshaft design means<br /> powerful performance in a compact package, and that performance is available in both<br /> propeller and jet-driven models to effectively power a myriad of applications and<br /> designs. With a newly-designed single throttle valve, a long intake track manifold,<br /> and an Electronic Control Module these engines feature easy starting, fast<br /> acceleration, and excellent top-end speed while still delivering the<br /> outstanding fuel-effi ciency Yamaha outboards are known for.<br /> <strong>RELIABILITY</strong><br /> Yamaha&rsquo;s proven 40hp four-stroke outboard design now comes with the<br /> addition of electronic multi-point fuel injection for easy, turn-key starting.<br /> A large, on-engine water-separating fuel fi lter further adds to its long-term<br /> reliability approach, as does an integral engine monitoring and warning<br /> system and Yamaha&rsquo;s renowned Ultimate Corrosion Protection System.<br /> These features help provide the peace of mind that comes standard with<br /> every Yamaha outboard.<br /> <strong>CONVENIENCE AND CONTROL</strong><br /> Yamaha&rsquo;s F40A has met the digital age. Optional Command Link&reg; gauges<br /> can now be rigged to this versatile engine. Even Yamaha&rsquo;s exclusive Variable<br /> Trolling RPM Switch (VTS&trade;) is standard on Command Link or Multifunction<br /> Tiller Handle-equipped models. The benefi t? Ultimate convenience, expansive<br /> available information, great control; all in a compact, easy-to-own-and-operate<br /> package.<br /> <strong>VALUE</strong><br /> Enhanced reliability. Exceptionally smooth and quiet operation. Outstanding<br /> fuel effi ciency. Maximum performance and convenience. All combine to make<br /> the new Yamaha F40A an incredibly powerful and versatile value, both now<br /> and in the years ahead.<br /> <br /> <br /> <br /> ', 1, 2, 0, 3, '2008-11-24 14:08:32', 67, '', '2008-12-01 11:50:39', 64, 0, '0000-00-00 00:00:00', '2008-11-24 13:48:29', '0000-00-00 00:00:00', '250pk.jpg|||0||bottom|right|\r\nfood/f40x.jpg|right||0||top|right|', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 14, 0, 8, '', '', 0, 2020),
(27, 'Product', 'Product', '<p>\r\n<strong>PEMIKIRAN INOVATIF DAN DAYA AIR REVOLUSIONER</strong>\r\n</p>\r\n<p align="justify">\r\n{mosimage}Saat ini, mesin tempel Yamaha digunakan dan digemari oleh masyarakat diberbagai negara seluruh dunia, berbagai macam lingkungan dan juga berbagai jenis penggunaan, Penggunaan perahu hidupnya tergantung pada produk Yamaha, sampai saat penggunaan perahu itu berakhir. Tahu bahwa motor ini sangat berkualitas dan terpercaya, yang membuat &nbsp;setiap orang percaya. Selama lebih dari 50th Yamaha telah menyediakan mesin tempel ang kuat dan handal kepada sebagian besar pengguna perahu diseluruh masyarakat yang mengandalkan hidupnya di air.&nbsp;{mosimage}\r\n</p>\r\n', '', -2, 0, 0, 0, '2008-11-25 09:16:28', 67, '', '2008-11-25 10:12:01', 67, 0, '0000-00-00 00:00:00', '2008-11-25 09:16:08', '0000-00-00 00:00:00', 'food/index.jpg|||0||bottom|right|\nfood/index 2.jpg|right||0||top|right|', '', 'menu_image=-1\nitem_title=1\npageclass_sfx=\nback_button=\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=', 1, 0, 0, '', '', 0, 154),
(28, 'Teknologi Outboard motor Yamaha', '', '<div align="justify">\r\nTeknologi mesin 4 langkah Yamaha berasal dari pengalaman bertahun-tahun di barisan(front) terdepan dari sepeda motor, otomotif bahkan dari pengembangan mesin untuk lomba F1. Tahun2 tesebut diwarnai dengan banyaknya inovasi yang mendobrak dari para insinyur Yamaha dalam rangka terus mengejar kemajuan teknologi yang menyeimbangkan performa dan penghematan. Itulah alasan kami senantiasa menentukan masa depan motor tempel. Dengan Yamaha, masa depan adalah saat ini.  \r\n</div>\r\n<script type="text/javascript">\r\n<!--\r\ngoogle_ad_client = "pub-9469600514042063";\r\n/* 468x15, created 9/27/09 */\r\ngoogle_ad_slot = "2340865220";\r\ngoogle_ad_width = 468;\r\ngoogle_ad_height = 15;\r\n//-->\r\n</script>\r\n<script src="http://pagead2.googlesyndication.com/pagead/show_ads.js" type="text/javascript">\r\n</script>\r\n<div align="justify">\r\n{mosimage}&nbsp;  \r\n</div>\r\n<div align="justify">\r\n</div>\r\n', '', 1, 4, 0, 20, '2008-11-25 10:31:09', 67, '', '2009-09-28 12:28:02', 64, 0, '0000-00-00 00:00:00', '2008-11-25 10:25:02', '0000-00-00 00:00:00', 'food/index.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 10, 0, 2, 'Offices, Offices, Teknologi Outboard motor Yamahaoutboard motor', 'outboard motor yamaha', 0, 392),
