(36, 'Uncatagorized Articel', '', 'Four Stroke Oil<br /> <br /> Four Stroke Marine<br /> 4M FC-W&reg; Re-formulation<br /> 4M FC-W&reg; (SAE 10W-30)<br /> 4M FC-W&reg; (SAE 20W-40)&nbsp;<br /> <br /> Two Stroke Oil<br /> <br /> &nbsp; 	Two Stroke Outboard<br /> Yamalube 2M<br /> Two Stroke Engine Oil<br /> Semi-Synthetic Injector Oil For Outboard Motors<br /> Naturally, any outboard oil should be TC-W3&reg; approved. Yamalube oils are so good they actually have been used as the test oil for many of the TC-W3 ratings! That means that all other TC-W3 oils had to measure up to our high standards. Given that, we raised the bar again with Yamalube 2M - the new standard for outboard oils.<br /> ', '', -1, 1, 0, 1, '2008-12-01 13:57:02', 64, '', '2009-09-28 12:29:41', 0, 0, '0000-00-00 00:00:00', '2008-12-01 13:56:20', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 1, 0, 1, '', '', 0, 6),
