(38, 'Welcome to Our Site', 'Yamaha Outboard Motor', '<div style="text-align: center">\r\n</div>\r\n<img src="images/stories/yamaha.jpg" alt="yamaha.jpg" title="yamaha.jpg" style="margin: 5px" align="middle" height="199" width="600" /><br />\r\n<div align="center">\r\n<img src="images/stories/yamahaheader2.jpg" alt="yamahaheader2.jpg" title="yamahaheader2.jpg" style="margin: 5px" align="middle" height="199" width="600" />\r\n</div>\r\n<br />\r\n<div style="text-align: center">\r\n<img src="images/stories/yamalube__yamaha_genuine_parts.jpg" alt="yamalube__yamaha_genuine_parts.jpg" title="yamalube__yamaha_genuine_parts.jpg" style="margin: 5px" height="120" width="507" />\r\n</div>\r\n<div style="text-align: center">\r\n<img src="images/stories/beatiful_oceans_forever_-_yamaha.jpg" alt="beatiful_oceans_forever_-_yamaha.jpg" title="beatiful_oceans_forever_-_yamaha.jpg" style="margin: 5px; width: 264px; height: 232px" align="middle" height="232" width="264" />\r\n</div>\r\n', '', 1, 2, 0, 3, '2010-05-10 00:00:00', 62, '', '2010-05-10 15:41:23', 64, 316, '2011-02-21 14:35:26', '2010-05-10 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 25, 0, 4, 'mesin tempel yamaha, mesin tempel, yamaha outboard motor, mesin kapal, yamalube, ', 'yamaha outboard motor', 0, 858),
