(40, 'Remote Control', '', '<p>PowerMached Puts you in control&nbsp;</p><p>Whether you&#39;re captain of a triple-engine cruiser or a backwater jon boat, you want easy, effortless control of your craft. It doesn&rsquo;t matter if you&rsquo;re running 350 horses or 30, you&#39;ll want the performance of a Yamaha PowerMatched&trade; System. Yamaha&#39;s advanced engine controls have a sleek, ergonomic design, giving you one-hand operation of both shift and throttle functions. On multi-engine controls, a single thumb-operated button trims all engines, and the neutral/warm-up button is nestled conveniently on the handle. The externally-adjustable throttle friction and our new-generation internal mechanism give you exceptionally smooth operation. Yamaha Premium Binnacle Controls have a polished chrome finish to add a touch of style to any boat, and they&#39;re available in single, dual and triple configurations.</p><p>Fingertip Control Yamaha puts command at your fingertips with a full array of sleek, ergonomic, smooth-operating controls.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '', 1, 1, 0, 18, '2008-12-06 09:45:47', 67, '', '0000-00-00 00:00:00', 0, 67, '2008-12-06 10:40:53', '2008-12-06 09:43:35', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 1, 0, 1, '', '', 0, 312),
