(43, 'Meters or Gauges', 'Meters or Gauges', '<div align="center">\r\n<img src="images/stories/meters--speedometer-digital.jpg" alt="meters--speedometer-digital.jpg" title="meters--speedometer-digital.jpg" style="margin: 5px" width="104" align="middle" height="105" />&nbsp;&nbsp;&nbsp;&nbsp; <img src="images/stories/meters--speedometer-analog.jpg" alt="meters--speedometer-analog.jpg" title="meters--speedometer-analog.jpg" style="margin: 5px" width="221" align="middle" height="105" /> &nbsp; &nbsp;&nbsp; <img src="images/stories/meters--tachometer-analog.jpg" alt="meters--tachometer-analog.jpg" title="meters--tachometer-analog.jpg" style="margin: 5px" width="218" align="middle" height="105" />\r\n</div>\r\n', '', 1, 1, 0, 32, '2009-03-12 13:52:16', 62, '', '2009-03-12 14:07:50', 62, 0, '0000-00-00 00:00:00', '2009-03-12 00:00:00', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', 7, 0, 1, '', '', 0, 263),
(44, 'Maintenance', 'Maintenance', '<p>\r\n&nbsp;\r\n</p>\r\n<p>\r\n<img src="images/stories/250pk.jpg" alt="250pk.jpg" title="250pk.jpg" style="margin: 5px; float: left" width="165" height="315" />You<cite title="tes">r propeller can be the deciding factor in your\r\noutboard''s ultimate acceleration, top speed, fuel economy, and engine\r\nlife. There''s only one way to ensure a perfect match to your Yamaha\r\noutboard: Use a Yamaha <img src="images/stories/inset_propeller_01a.jpg" alt="Image" title="Image" width="117" border="0" height="111" hspace="6" />propeller.\r\nYamaha engineers use exacting specifications to engineer our\r\npropellers, then they test them with the engines they''re intended for.\r\nThere''s a Yamaha propeller perfectly matched to every Yamaha engine.\r\nFor boats of every size. For saltwater or running in the weeds. For\r\nhigh performance and demanding tournament pros. Even our exclusive Dual\r\nThrust&trade; for heavy loads. Want to get the most from your Yamaha\r\noutboard? Run with the Yamaha propeller designed to achieve its full\r\nperformance potential. &nbsp;</cite><br />\r\n<br />\r\n&nbsp;	Innovation | Reliability | Convenience<br />\r\n<br />\r\nH4 Series Propellers	HS4 &ldquo;High Seas&rdquo; Propellers<br />\r\n<img src="images/stories/fruit/blacksteelserie-100.jpg" alt="Image" title="Image" width="100" border="0" height="100" hspace="6" /> \r\n</p>\r\n', '', 1, 0, 0, 0, '2009-03-12 14:43:15', 62, '', '2009-03-13 15:19:50', 62, 0, '0000-00-00 00:00:00', '2009-03-12 14:42:54', '0000-00-00 00:00:00', '', '', 'menu_image=-1\nitem_title=1\npageclass_sfx=\nback_button=\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=1\nprint=\nemail=', 1, 0, 0, '', '', 0, 1550),
